import React from "react";
import Toggler from "./Toggler";
import classes from './style.module.css'
import DarkModeToggle from 'react-dark-mode-toggle'

const ModeToggler = (props) => {

    return <div className={classes.toggler}>
        <p className={classes.lightMode}>{props.darkMode ? "Dark mode" : "Light mode"}</p>
        <div className={classes.blankGap}></div>
        <DarkModeToggle
            onChange={props.setDarkMode}
            checked={props.darkMode}
        />
        <Toggler darkMode={props.darkMode} setDarkMode={props.setDarkMode}/>
    </div>
}

export default ModeToggler
